import React from 'react';

const Scrollup = () => {
    return (
        <div id="scroll-to-top" className="scroll-to-top">
            <a key="1" className="Discord" href="https://discord.gg/RaXvVfFD"target="_blank">
                <i className="fab fa-discord" />
            </a>
        </div>
    );
};

export default Scrollup;
